function Table(props)
{
    return (
        <div className="Table">
            <div className="Table_number">
                    Table {`${props.table_number}`}
            </div>
            <div className="Table_status">
                status : {`${props.table_status}`}
            </div>
        </div>
    )
}

export default Table;
